import logo from './logo.svg';
import './App.css';
import { Children } from 'react';

const Li = ({children, id}) => {
  // console.log(props);

  return (
    <li className='css-li'>{children} {id}</li>
  );
};

function App() {
  const value = 'test';

  return (
    <ul className='css-ul'>
      <Li id='1'>value</Li>
    </ul>
  );
}

export default App;
